﻿<!DOCTYPE html>
<html>
<head>
    <title>adMarketplace</title>
    <meta http-equiv="Cache-Control" content="no-cache" />
    <meta http-equiv="Pragma" content="no-cache" />
    <meta http-equiv="Expires" content="0" />
    <meta charset="utf-8" />
	<style type="text/css" media="screen">
		body {background:transparent;color:#000;font-family:Arial,sans-serif;font-size:.8em;width:728px!important;height:90px!important;overflow:hidden;margin:0;padding:0;}
		a {color:#000;text-decoration:none;}
		.ad-title {color:#1122CC;display:block;clear:both;font-size:1.3em;}
		.ad-container {width:728px!important;height:90px!important;overflow:hidden;margin:0;padding:0;background:red;}
		.ad-unit {display:block;float:left;margin:0px;padding:4px;border:dashed 1px #D7D7D7;background:#fff;cursor:pointer;width:718px;height:80px;position:relative;}
		.ad-image {width:104px;height:78px;float:left;margin-right:8px;border-style:none;}
		.ad-body {float:left;margin-right:8px;width:584px;height:78px;}
		.ad-body table {width:580px;height:78px;font-family:Arial, sans-serif;font-size:13px;line-height:1.6em;font-weight:400;}
		.ad-arrow {float:left;width:12px;height:12px;background:#F2F2F2;color:#C6C6C6;padding:33px 1px;text-align:center;}
		.ad-unit:hover .ad-arrow {color:#1122CC;background:#F0F0F0;}
		.ad-unit:hover {border:solid 1px #C6C6C6;}
		.pub-px { position: absolute; left: 0px; top: 0px; width: 1px; height: 1px; }
	</style>
</head>
<body>
	<img src="${pubPixel1}" class="pub-px" />
	<div class="ad-container">
		<a class="ad-unit" href="${clickUrl1}" target="_blank">
			<div class="ad-image"><img src="${thumbUrl1}" class="ad-image"/></div>
			<div class="ad-body">
				<table><tr><td>
					<span class="ad-title">${title1}</span>
					${description1} &raquo;
				</td></tr></table>
			</div>
			<div class="ad-arrow">►</div>
		</a>
	</div>
</body>
</html>
